var app=angular.module("app",["ngMaterial"]);app.service("ServiceUsers",["$http","$q",function($http,$q){this.getUsers=function(){var deferred=$q.defer();return $http.get("data.json").success(function(data){deferred.resolve(data)}).error(function(error){deferred.reject(error)}),deferred.promise}}]),app.controller("toolbarCtrl",["$scope","ServiceUsers","$timeout","$mdSidenav",function($scope,ServiceUsers,$timeout,$mdSidenav){function debounce(func,wait,context){var timer;return function(){var context=$scope,args=Array.prototype.slice.call(arguments);$timeout.cancel(timer),timer=$timeout(function(){timer=void 0,func.apply(context,args)},wait||10)}}function buildDelayedToggler(navID){return debounce(function(){$mdSidenav(navID).toggle().then(function(){console.log("toggle "+navID+" is done")})},200)}var promesa=ServiceUsers.getUsers();promesa.then(function(users){$scope.users=users},function(reason){console.log("Failed: "+reason)}),$scope.toggleLeft=buildDelayedToggler("left")}]),app.controller("LeftCtrl",["$scope","$timeout","$mdSidenav",function($scope,$timeout,$mdSidenav){$scope.close=function(){$mdSidenav("left").close().then(function(){console.log("close LEFT is done")})}}]);